import React from "react";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import { withStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import CardDisplay from "./Card";
import { connect } from "react-redux";
import axios from "axios";
import Card from "@material-ui/core/Card";
import { CardHeader } from "@material-ui/core";
const styles = theme => ({
  root: {
    flexGrow: 1,
    display: "flex",
    justifyContent: "center"
    //    alignItems: "center",
    //         height: "100vh"
  },
  fab: {
    marginLeft: "90px",
    marginTop: "45px"
  },
  label: {
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "26px",
    margin: theme.spacing.unit * 2,
    color: "#1C80B5",
    width: 800
  }
});
class Home extends React.Component {
  state = {
    // cards: [
    //   { id: 1, LocalcarrierCode: "XB" },
    //   { id: 2, LocalcarrierCode: "HC" }
    // ]
    cards: []
  };
  componentDidMount() {
    axios.get(`http://10.24.46.59:8080/carrierapi/getCarriers`).then(res => {
      const cards = res.data;
      console.log(cards);
      this.setState({ cards });
    });
  }
  handle = () => {
    this.props.history.push(`/admin/CarrierDetails`);
    // const cards = this.state.cards;
    // cards.push({ id: 3, LocalcarrierCode: "BA" });
    // this.setState(cards);
  };
  render() {
    const { classes } = this.props;
    console.log(this.props);
    return (
      <div>
        <Card className="label">
          <CardHeader
            classes={{ title: classes.label }}
            title="Welcome to configurator use this screen to manage and add a new carrier"
          />
        </Card>
        <div
          className={classes.root}
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "70vh"
          }}
        >
          <Grid container xs={24}>
            {this.state.cards.map(card => (
              <Grid item xs={3}>
                <CardDisplay
                  key={card.id}
                  LocalcarrierCode={card.carrierName}
                  selected={true}
                />
              </Grid>
            ))}

            <Grid item xs={3}>
              <Fab
                size="large"
                aria-label="Add"
                onClick={this.handle}
                className={classes.fab}
              >
                <AddIcon />
              </Fab>
            </Grid>
          </Grid>
        </div>
      </div>
    );
  }
}
const mapStateToProps = state => {
  return state;
};

const Reduxhome = connect(mapStateToProps)(Home);
export default withStyles(styles)(Reduxhome);
